  true,\n\t\"url\": null,\n\t\"notes\": \"National Land Cover Database 2011 (NLCD
  2011) is the most recent national land cover product created by the Multi-Resolution
  Land Characteristics (MRLC) Consortium. NLCD 2011 provides - for the first time
  - the capability to assess wall-to-wall, spatially explicit, national land cover
  changes and trends across the United States from 2001 to 2011. As with two previous
  NLCD land cover products NLCD 2011 keeps the same 16-class land cover classification
  scheme that has been applied consistently across the United States at a spatial
  resolution of 30 meters. NLCD 2011 is based primarily on a decision-tree classification
  of circa 2011 Landsat satellite data. nnThis dataset is associated with the following
  publication:nHomer, C., J. Dewitz, L. Yang, S. Jin, P. Danielson, G. Xian, J. Coulston,
  N. Herold, J. Wickham , and K. Megown. Completion of the 2011 National Land Cover
  Database for the Conterminous United States &ndash; Representing a Decade of Land
  Cover Change Information.   PHOTOGRAMMETRIC ENGINEERING AND REMOTE SENSING. American
  Society for Photogrammetry and Remote Sensing, Bethesda, MD, USA, 81(0): 345-354,
  (2015).\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\": [{\n\t\t\"key\":
